import React, { useState } from "react";
import "./UserDashboard.css";

function UsuarioDashboard() {
  const [showModal, setShowModal] = useState(null);
  const [modalData, setModalData] = useState("");
  const [formData, setFormData] = useState({
    nuevoNombreUsuario: "",
    nombreUsuario: "",
    dni: "",
    nuevaContrasena: "",
    codigoEdificio: "",
    piso: "",
    numeroUnidad: "",
    ubicacion: "",
    descripcion: "",
    tipoReclamo: "",
    idReclamo: "",
    idImagen: "",
    archivo: null,
  });

  const cerrarSesion = () => {
    localStorage.removeItem("jwtToken");
    alert("Sesión cerrada. Redirigiendo a la página de inicio.");
    window.location.href = "http://localhost:3000/";
  };

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleFileChange = (e) => {
    setFormData({ ...formData, archivo: e.target.files[0] });
  };

  const fetchData = async (url, method, body) => {
    try {
      const headers = {
        "Content-Type": "application/json",
        Authorization: `Bearer ${localStorage.getItem("jwtToken")}`,
      };

      const options = { method, headers };
      if (body) options.body = JSON.stringify(body);

      const response = await fetch(url, options);
      if (!response.ok) {
        const errorData = await response.json();
        throw new Error(errorData.message || "Error desconocido");
      }
      if (response.status !== 204) return await response.json(); // Maneja respuestas vacías
      return {};
    } catch (error) {
      console.error("Error:", error.message);
      alert(`Error: ${error.message}`);
      throw error;
    }
  };

  // Métodos para cada acción
  const actualizarNombreUsuario = async () => {
    await fetchData("http://localhost:8080/api/usuario/actualizar-nombre-usuario", "PUT", {
      nuevoNombreUsuario: formData.nuevoNombreUsuario,
    });
    alert("Nombre de usuario actualizado con éxito. Por favor, vuelve a iniciar sesión.");
    cerrarSesion();
  };

  const restablecerContrasena = async () => {
    await fetchData("http://localhost:8080/api/usuario/restablecerContrasena", "POST", {
      nombreUsuario: formData.nombreUsuario,
      dni: formData.dni,
      nuevaContrasena: formData.nuevaContrasena,
    });
    alert("Contraseña restablecida correctamente. Por favor, vuelve a iniciar sesión.");
    cerrarSesion();
  };

  const agregarReclamoConUnidad = async () => {
    await fetchData("http://localhost:8080/api/reclamos/conUnidad", "POST", {
      codigoEdificio: formData.codigoEdificio,
      piso: formData.piso,
      numeroUnidad: formData.numeroUnidad,
      ubicacion: formData.ubicacion,
      descripcion: formData.descripcion,
      tipoReclamo: formData.tipoReclamo,
    });
    alert("Reclamo agregado con éxito.");
  };

  const agregarReclamoSinUnidad = async () => {
    await fetchData("http://localhost:8080/api/reclamos/sinUnidad", "POST", {
      codigoEdificio: formData.codigoEdificio,
      ubicacion: formData.ubicacion,
      descripcion: formData.descripcion,
      tipoReclamo: formData.tipoReclamo,
    });
    alert("Reclamo agregado con éxito.");
  };

  const actualizarReclamo = async () => {
    await fetchData("http://localhost:8080/api/reclamos/actualizar", "PUT", {
      idReclamo: formData.idReclamo,
      ubicacion: formData.ubicacion,
      descripcion: formData.descripcion,
    });
    alert("Reclamo actualizado con éxito.");
  };

  const agregarImagenAlReclamo = async () => {
    const formDataObj = new FormData();
    formDataObj.append("archivo", formData.archivo);
    formDataObj.append("idReclamo", formData.idReclamo);

    await fetch("http://localhost:8080/api/imagenes/agregar", {
      method: "POST",
      headers: { Authorization: `Bearer ${localStorage.getItem("jwtToken")}` },
      body: formDataObj,
    });
    alert("Imagen agregada con éxito.");
  };

  const actualizarImagenDelReclamo = async () => {
    const formDataObj = new FormData();
    formDataObj.append("archivo", formData.archivo);

    await fetch(`http://localhost:8080/api/imagenes/actualizar/${formData.idImagen}`, {
      method: "PUT",
      headers: { Authorization: `Bearer ${localStorage.getItem("jwtToken")}` },
      body: formDataObj,
    });
    alert("Imagen actualizada con éxito.");
  };

  const eliminarImagenDelReclamo = async () => {
    await fetchData(`http://localhost:8080/api/imagenes/${formData.idImagen}`, "DELETE");
    alert("Imagen eliminada con éxito.");
  };

  const verImagenPorReclamo = async () => {
    const data = await fetchData(
      `http://localhost:8080/api/imagenes/ver/reclamo/${formData.idReclamo}`,
      "GET"
    );
    setModalData(JSON.stringify(data, null, 2));
  };

  const verMisReclamos = async () => {
    const data = await fetchData("http://localhost:8080/api/reclamos/mis-reclamos", "GET");
    setModalData(JSON.stringify(data, null, 2));
  };

  const verReclamoPorId = async () => {
    const data = await fetchData(
      `http://localhost:8080/api/reclamos/${formData.idReclamo}`,
      "GET"
    );
    setModalData(JSON.stringify(data, null, 2));
  };

  return (
    <div className="user-dashboard">
      <header className="dashboard-header">
        <h1 className="dashboard-title">PROPSUITE</h1>
        <nav className="header-buttons">
          <div className="dropdown">
            <button className="nav-button">Usuario</button>
            <ul className="dropdown-menu">
              <li>
                <button onClick={() => setShowModal("actualizarNombreUsuario")}>
                  Actualizar nombre de usuario
                </button>
              </li>
              <li>
                <button onClick={() => setShowModal("restablecerContrasena")}>
                  Restablecer contraseña
                </button>
              </li>
              <li>
                <button onClick={cerrarSesion}>Cerrar sesión</button>
              </li>
            </ul>
          </div>
        </nav>
      </header>

      <div className="section-container">
        <h2 className="section-title">Reclamos</h2>
        <button onClick={agregarReclamoConUnidad}>Agregar Reclamo a Unidad</button>
        <button onClick={agregarReclamoSinUnidad}>Agregar Reclamo a Área Común</button>
        <button onClick={actualizarReclamo}>Actualizar Reclamo</button>
        <button onClick={agregarImagenAlReclamo}>Agregar Imagen al Reclamo</button>
        <button onClick={actualizarImagenDelReclamo}>Actualizar Imagen del Reclamo</button>
        <button onClick={eliminarImagenDelReclamo}>Eliminar Imagen del Reclamo</button>
        <button onClick={verImagenPorReclamo}>Ver Imagen por Reclamo</button>
        <button onClick={verMisReclamos}>Ver Mis Reclamos</button>
        <button onClick={verReclamoPorId}>Ver Reclamo por ID</button>
      </div>

      {showModal && (
        <div className="modal">
          <div className="modal-content">
            <h2>{showModal}</h2>
            {modalData ? (
              <pre>{modalData}</pre>
            ) : (
              <form>
                {/* Inputs dinámicos */}
              </form>
            )}
            <button onClick={() => setShowModal(null)}>Cerrar</button>
          </div>
        </div>
      )}
    </div>
  );
}

export default UsuarioDashboard;
